// Ajax loader calls spinner
$('body').ajaxStop(function() {
	$('#loading').fadeOut();
	spinner.stop();
}).ajaxError(function(e, jqxhr, settings, exception) {
	console.log('An error occurer with the last ajax request. Exception:' + exception);
	$('#loading').fadeOut();
	spinner.stop();
});
